George Clarkes Amazing Christmas Spaces

Arts, Technology Documentary hosted by George Clarke, published by Channel 4 in 2013 - English narration


Information
------------------------------

George Clarke's Amazing Christmas Spaces 
In this festive special, George visits an incredible man-made stalactite crystal grotto in Surrey and meets a small spaces enthusiast who has rebuilt and renovated a Victorian flat-pack tin chapel in Shropshire to create a magical holiday home. George catches up with carpenter Adam, who created a double-decker bus holiday home on the Brighton coastline, with Jay and Jonathan at their ambulance-turned-campervan in Norfolk, and Barry at his hexagonal home in Lancashire.
Meanwhile, it's Christmas in the tree house with Rew from the Land Rover cocktail bar helping to get the celebrations started.

